    false,nt"url": null,nt"notes": "Map service for the Montana Structures
    MSDI Framework. The service will only display at scales of 1:100,000 or larger.
    Structures are grouped into general categories based on the function, or type of
    structure. For example, the "Emergency services and law enforcment" category includes
    law enforcement, fire stations, ambulance services, emergency shelters, EOCs, and
    search and rescue. The Montana Structures/Addresses Framework is a statewide spatial
    database of structure and address points in the State of Montana. The Montana Structures/Addresses
    Framework is part of the Montana Spatial Data Infrastructure (MSDI). The goal of
    the Montana Structures/Addresses Framework is to have a routinely updated statewide
    database of primary structures/buildings and addresses. Through a federated approach,
    the project integrates structures data from local, state, federal and private data
    providers into the standardized Montana Structures Database. For more information
    about the included datasets, see Source information in the Data Quality Information
    section of this document or the feature level metadata tables in the database.",nt"license_title":
